%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
% "ModernCV" CV and Cover Letter
% LaTeX Template
% Version 1.11 (19/6/14)
%
% This template has been downloaded from:
% http://www.LaTeXTemplates.com
%
% Original author:
% Xavier Danaux (xdanaux@gmail.com)
%
% License:
% CC BY-NC-SA 3.0 (http://creativecommons.org/licenses/by-nc-sa/3.0/)
%
% Important note:
% This template requires the moderncv.cls and .sty files to be in the same 
% directory as this .tex file. These files provide the resume style and themes 
% used for structuring the document.
%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

%----------------------------------------------------------------------------------------
%	PACKAGES AND OTHER DOCUMENT CONFIGURATIONS
%----------------------------------------------------------------------------------------

\documentclass[11pt,a4paper,sans]{moderncv} % Font sizes: 10, 11, or 12; paper sizes: a4paper, letterpaper, a5paper, legalpaper, executivepaper or landscape; font families: sans or roman

\moderncvstyle{casual} % CV theme - options include: 'casual' (default), 'classic', 'oldstyle' and 'banking'
\moderncvcolor{blue} % CV color - options include: 'blue' (default), 'orange', 'green', 'red', 'purple', 'grey' and 'black'
\usepackage{fontspec}
\usepackage{lipsum} % Used for inserting dummy 'Lorem ipsum' text into the template

\usepackage[scale=0.75]{geometry} % Reduce document margins
%\setlength{\hintscolumnwidth}{3cm} % Uncomment to change the width of the dates column
%\setlength{\makecvtitlenamewidth}{10cm} % For the 'classic' style, uncomment to adjust the width of the space allocated to your name

%----------------------------------------------------------------------------------------
%	NAME AND CONTACT INFORMATION SECTION
%----------------------------------------------------------------------------------------

\firstname{% verbatim %}{
{% endverbatim %}{{ cv.human.prenume }}} % Your first name
\familyname{% verbatim %}{
{% endverbatim %}{{ cv.human.nume }}} % Your last name

% All information in this block is optional, comment out any lines you don't need
\title{Curriculum Vitae}
% \address{123 Broadway}{City, State 12345}
% \mobile{(000) 111 1111}
\phone{% verbatim %}{
{% endverbatim %}{{ cv.human.phone }}}
% \fax{(000) 111 1113}
\email{% verbatim %}{
{% endverbatim %}{{ cv.human.email|texify|safe }}}
% \homepage{% verbatim %}{
% {% endverbatim %}{{ cv.human.web }}}{% verbatim %}{
% {% endverbatim %}{{ cv.human.web }}} % The first argument is the url for the clickable link, the second argument is the url displayed in the template - this allows special characters to be displayed such as the tilde in this example
% \extrainfo{additional information}
% \photo[70pt][0.4pt]{pictures/picture} % The first bracket is the picture height, the second is the thickness of the frame around the picture (0pt for no frame)
% \quote{"A witty and playful quotation" - John Smith}

%----------------------------------------------------------------------------------------

\begin{document}

\makecvtitle % Print the CV title

%----------------------------------------------------------------------------------------
%	EDUCATION SECTION
%----------------------------------------------------------------------------------------
{% if cv.studies.all %}
\section{Education}
{% for study in cv.studies.all %}
\cventry{% verbatim %}{
{% endverbatim %}{{ study.years }}}{% verbatim %}{
{% endverbatim %}{{ study.faculty|texify|safe }}}{% verbatim %}{
{% endverbatim %}{{ study.inst|texify|safe }}}{}{}{}  % Arguments not required can be left empty
{% endfor %}
{% endif %}

%----------------------------------------------------------------------------------------
%	WORK EXPERIENCE SECTION
%----------------------------------------------------------------------------------------
{% if cv.works.all %}
\section{Experience}
{% for work in cv.works.all %}
\cventry{% verbatim %}{
{% endverbatim %}{{ work.years }}}{% verbatim %}{
{% endverbatim %}{{ work.function|texify|safe }}}{\textsc{% verbatim %}{
{% endverbatim %}{{ work.inst|texify|safe }}}}{}{}{% verbatim %}{
{% endverbatim %}{{ work.comments|texify|safe }}}
{% endfor %}
{% endif %}
%------------------------------------------------

%----------------------------------------------------------------------------------------
%	AWARDS SECTION
%----------------------------------------------------------------------------------------
{% if cv.awards.all %}
\section{Awards}
{% for award in cv.awards.all %}
\cvitem{% verbatim %}{
{% endverbatim %}{{ award.year }}}{% verbatim %}{
{% endverbatim %}{{ award.title|texify|safe }}}
{% endfor %}
{% endif %}

%----------------------------------------------------------------------------------------
%	COMPUTER SKILLS SECTION
%----------------------------------------------------------------------------------------
{% if cv.abilities.all %}
\section{Skills}
{% for skill in cv.abilities.all %}
\cvitem{% verbatim %}{
{% endverbatim %}{{ skill.title|texify|safe }}}{% verbatim %}{
{% endverbatim %}{{ skill.comment|texify|safe }}}
{% endfor %}
{% endif %}
%----------------------------------------------------------------------------------------
%	LANGUAGES SECTION
%----------------------------------------------------------------------------------------

\section{Languages}

\cvitemwithcomment{English}{Mothertongue}{}
\cvitemwithcomment{Spanish}{Intermediate}{Conversationally fluent}
\cvitemwithcomment{Dutch}{Basic}{Basic words and phrases only}

\end{document}

