%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

\documentclass[letterpaper]{deedy-resume} % Use US Letter paper, change to a4paper for A4 
\usepackage{fontspec}
\begin{document}

%----------------------------------------------------------------------------------------
%	TITLE SECTION
%----------------------------------------------------------------------------------------

\lastupdated % Print the Last Updated text at the top right

\namesection{
{{ cv.human.prenume }}}{%
{{ cv.human.nume }}}{ % Your name
\urlstyle{same}\url{http://{{ cv.human.web }}} \\ % Your website, LinkedIn profile or other web address
\href{mailto:{{ cv.human.email }}}{%
{{ cv.human.email }}} | {{ cv.human.phone }} % Your contact information
}

%----------------------------------------------------------------------------------------
%	LEFT COLUMN
%----------------------------------------------------------------------------------------

\begin{minipage}[t]{0.33\textwidth} % The left column takes up 33% of the text width of the page

%------------------------------------------------
% Education
%------------------------------------------------
{% if cv.studies.all %}
\section{Education} 

{% for study in cv.studies.all %}
\subsection{%
{{ study.inst|texify|safe }}}

\descript{%
{{ study.faculty|texify|safe }}}
\location{%
{{ study.years }}}

\sectionspace % Some whitespace after the section
{% endfor %}
{% endif %}

%------------------------------------------------
% Coursework
%------------------------------------------------
{% if cv.awards.all %}
\section{Awards}

{% for award in cv.awards.all %}
\subsection{%
{{ award.title|texify|safe }}}

{{ award.description|texify|safe }} \\
{\footnotesize \textit{\textbf{%
{{ award.year }} }}}
\sectionspace % Some whitespace after the section
{% endfor %}
{% endif %}

%------------------------------------------------
% Skills
%------------------------------------------------
{% if cv.abilities.all %}
\section{Skills}

{% for skill in cv.abilities.all %}
\subsection{%
{{ skill.title|texify|safe }}}

{{ skill.comment|texify|safe }}
\sectionspace % Some whitespace after the section
{% endfor %}
{% endif %}

%----------------------------------------------------------------------------------------

\end{minipage} % The end of the left column
\hfill
%
%----------------------------------------------------------------------------------------
%	RIGHT COLUMN
%----------------------------------------------------------------------------------------
%
\begin{minipage}[t]{0.66\textwidth} % The right column takes up 66% of the text width of the page

%------------------------------------------------
% Experience
%------------------------------------------------
{% if cv.works.all %}
\section{Experience}

{% for work in cv.works.all %}
\runsubsection{%
{{ work.inst|texify|safe }}}
\descript{| {{ work.function|texify|safe }}}

\location{%
{{ work.years }}}
\vspace{\topsep} % Hacky fix for awkward extra vertical space
{{ work.comments|texify|safe }}

\sectionspace % Some whitespace after the section
{% endfor %}
{% endif %}
%----------------------------------------------------------------------------------------

\end{minipage} % The end of the right column

%----------------------------------------------------------------------------------------
%	SECOND PAGE (EXAMPLE)
%----------------------------------------------------------------------------------------

%\newpage % Start a new page

%\begin{minipage}[t]{0.33\textwidth} % The left column takes up 33% of the text width of the page

%\section{Example Section}

%\end{minipage} % The end of the left column
%\hfill
%\begin{minipage}[t]{0.66\textwidth} % The right column takes up 66% of the text width of the page

%\section{Example Section 2}

%\end{minipage} % The end of the right column

%----------------------------------------------------------------------------------------

\end{document}

